column8:
ハマナカの従来品「アンダリヤ」の糸玉ラベル、色身等を一新した新商品です。<br>
編みかごやインテリア雑貨、モチーフから工作まで、年代を問わずお楽しみ頂けます。<br><br>

◆仕立：1玉40g巻（約80m）<br>
◆構成：レーヨン100％※木材パルプから生まれた天然成分繊維です。<br>
◆使用針：編み針5/0～7/0号<br><br>

※見本画像と現物の色が多少異なる場合がございます。<br>
※メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
<img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence/312-36-001a_evidence.jpg" width="500"><style type="text/css">
